INSERT INTO `sponsors` VALUES ('Chez-Ren','...Repent? Me? Cheek! I cant start repenting at my time of life. Id never get any work done. Anyway, I aint sorry for most of it.  --> T. Pratchet Carpe Jugulum','images/shan.png','http://127.0.0.1:8000/','m'),('Delta Conservancy','Working collaboratively and in coordination with local communities, the Conservancy will lead efforts to protect, enhance, and restore the Deltas economy, agriculture and working landscapes, and environment, for the benefit of the Delta region, its local communities, and the citizens of California','images/delta_conservancy.jpg','http://deltaconservancy.ca.gov/','s'),('cole International','We prepare students for membership of communities that are socially and culturally diverse, for citizenship, and for engagement with the political, ethical and environmental challenges of their times. This project helps with that ','images/Stemx.jpg','https://www.ecolint.ch/','s'),('Hammerdirt','...there is nothing like millions of years of really frustrating trial and error to give a species moral fiber and in some cases backbone... T. Pratchet REAPER MAN','images/roger.jpg','https://twitter.com/hammerdirt','m'),('Hammerdirt Gary','I am doing this for my daughter, its the right thing to do. If we had sponsors there would be alot more folks out here.','images/icon_seven.jpeg','https://twitter.com/HammerdirtGary','v'),('Helen','Its a strange thing about determined seekers-after-wisdom that...theyll always seek that wisdom which is a long way off. Wisdom is one of the few things that looks bigger the further away it is. T. Pratcher --> Witches Abroad','images/helen.jpg','https://twitter.com/leny','m'),('Panda Citizen','Then there was the puzzle of why the sun came out during the day, instead of at night when the light would come in useful. T. Pratchet --> Mort','images/panda.jpg','https://twitter.com/pandacitizen','m'),('Precious Plastic Leman','On a install un atelier au bord du Lman. Avec notre set de machines, on transforme les 7 types de dchets plastiques en de nouveaux objets.','images/bag_stick.jpg','https://preciousplasticleman.ch/','v'),('Solid Waste Engineer','...Were supposed to meddle with things we dont understand.  If we hung around waitin till we understood things wed never get anything done. --> T. Pratchet Interesting Times','images/icon_five.svg','https://infoscience.epfl.ch/record/214968?ln=en','v'),('STOPPP','The Swiss Litter Report is the first Switzerland-wide study on plastic and other waste pollution in Swiss rivers and lakes. The project took a Citizen Science approach with the collection and measurement carried out by trained volunteers.','images/stopp.jpg','http://www.stoppp.org/research_en','v'),('Tiger-duck-club','Semester project, EPFL Solid Waste Engineering.','images/tiger-duck.jpg','https://master.epfl.ch/programs/environment/','v'),('WWF Volunteers','Volunteers from the WWF were responsible for most of the sites within the Swiss Litter Report. Thanks for their efforts','images/people.png','https://www.wwf.ch/de?gclid=EAIaIQobChMIg_qY_7v03QIVWeJ3Ch1vTgFxEAAYASAAEgKLoPD_BwE','v');
